import Camel from '../images/resized/Camel.jpg';
import Gorilla from '../images/resized/Gorilla.jpg';
import Elephant2 from '../images/resized/Elephant2.jpg';
import Kangaroo from '../images/resized/Kangaroo.jpg'; //Unused
import Panda2 from '../images/resized/Panda2.jpg';
import Toucan from '../images/resized/Toucan.jpg';
import Hen from '../images/resized/Hen.jpg'; //Unused
import GreatWhiteShark from '../images/resized/GreatWhiteShark.jpg'; //Unused

const GetImageData = (index) => {
    var imageData = [
        [Camel, "Kamel"],
        [Toucan, "Toucan"],
        [Gorilla, "Gorilla"],
        [Panda2, "Panda"],
        [Hen, "Höna"]
    ];
    return imageData[index];
}
export default GetImageData;
